  palette: {
    primary: {
      light: '#c2dff2',
      main: '#5999D5',
      dark: '#314d83',
      contrastText: '#fff',
    },
    secondary:{
      main: '#314d83'
    }
  },
  //typography:{
    //fontFamily: 'Montserrat'
  //},
});

function App(props) {
  const [isAuthenticating, setIsAuthenticating] = useState(true);
  const [isAuthenticated, userHasAuthenticated] = useState(false);


  return (
    <MuiThemeProvider theme={theme}>
      <CssBaseline />
      <div className="root">
        <Routes />
      </div>
    </MuiThemeProvider>
  );
}

export default withRouter(App);
